class MemBmvBackward:
    def peakmem_bmv_backward(self, n, bshapes, naive):
        self.out.backward()

    def setup(self, n, bshapes, naive):
        A = torch.randn(*bshapes[0], n, n, requires_grad=True)
        x = torch.randn(*bshapes[1], n)
        self.out = bmv(A, x, naive=naive).mean()

